import { Component } from "react";
import Logo from "./Logo";
import Carro from "./Carro";

const styles = {
  navbar: {
    color: '#3e2623',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    backgroundColor: '#fff',
        padding: '0px 100px',
        position: 'fixed', 
    width: '90%', 
    top: 0, 
    zIndex: 9999 
  }
}

class Navbar extends Component {
  render() {
    const { carro } = this.props;
    return (
      <nav style={styles.navbar}>
        <Logo />
        <Carro carro={carro} />
      </nav>
    );
  }
}

export default Navbar;
